import './App.css';

const Description = () => {
    return 
    <p>Esta es la app del curso de fullstack bootcamp</p>
}

const App = () => {
    const a = 2;
    const b = 3;
    return ( 
    <div className = 'App'>
        <h1>Titulo de la aplicacion</h1> 
        <strong>Estamos trabajando en ello</strong>
        <div>
            <p>El resultado es:</p>
            {a + b}
        </div>
    </div>
    );
}

export default App;
